import React, { useState } from "react";
import { Routes, Route } from 'react-router-dom'
import SearchFilter from './SearchFilter'
import Profile from './Profile'
import LocationFilter from './LocationFilter'
import { Nav } from './Nav'
import { Footer } from './Footer'
import OpenerPage from './OpenerPage';
import LoginPage from './login';
import Liked from "./Liked";

const App = () => {
  const [likedItems, setLikedItems] = useState([]);

  return (
    <div>
      <Nav/>
      <Routes>
        <Route index element={<LoginPage/> } />
        <Route path='opener' element={<OpenerPage/>} />
        <Route path='gallery' element={<SearchFilter/> } />
        <Route path='profile' element={<Profile/>} />
        <Route path='sellers' element={<LocationFilter/> } />
        <Route path='liked' element={<Liked/> }/>
      </Routes>
      <Footer/>
      <SearchFilter setLikedItems={setLikedItems} likedItems={likedItems} />
      <Liked likedItems={likedItems} />
    </div>

  )
}

export default App
